<h1 class="title">献给你的进行曲</h1>
<p class="date">2020-07-19 21:34:34</p>
</header>
<p>《献给你的进行曲》又名《光州之歌》，是作曲家为了纪念韩国光州事件起义的人民而作的，具体对象是一对在反抗军政府暴政中死去的情侣。</p>
<p>这首歌本来很美好，表达了人民民主的诉求，革命者的伤感与坚毅，哀而不伤。但是被民粹主义、港毒之类的滥用，浪费了这曲子的好意义，沦落到鲜有人知。</p>
<p>简谱是我弄的，可能有误，原稿太潦草了，国内也不怎么找得到资料</p>
